import React, { useEffect, useState } from 'react';
import { environment } from '../environment.ts';

const MarksheetList = ({ user }) => {
  const [marksheets, setMarksheets] = useState([]);
  const [searchName, setSearchName] = useState(''); // State for name search
  const [searchRollNo, setSearchRollNo] = useState(''); // State for roll number search
  const [filteredMarksheets, setFilteredMarksheets] = useState([]); // State to hold filtered results

  const apiUrl = environment.apiUrl;

  const fetchMarksheets = () => {
    fetch(`${apiUrl}/api/marksheet/searchMarksheets`, { credentials: 'include' })
      .then(response => {
        if (response.ok) {
          return response.json();
        }
        throw new Error('Network response was not ok.');
      })
      .then(data => {
        setMarksheets(data);
        setFilteredMarksheets(data); // Initially, show all marksheets
      })
      .catch(error => {
        console.error('Error fetching marksheets:', error);
      });
  };

  useEffect(() => {
    fetchMarksheets();
  }, []);

  // Filter function based on search inputs
  useEffect(() => {
    const filtered = marksheets.filter(marksheet => {
      return (
        (marksheet.name.toLowerCase().includes(searchName.toLowerCase()) || searchName === '') &&
        (marksheet.rollNo.includes(searchRollNo) || searchRollNo === '')
      );
    });
    setFilteredMarksheets(filtered);
  }, [searchName, searchRollNo, marksheets]);

  const calculateTotal = (marksheet) => {
    return marksheet.physics + marksheet.chemistry + marksheet.maths;
  };

  const calculatePercentage = (marksheet) => {
    const total = calculateTotal(marksheet);
    return (total / 300) * 100; // Assuming each subject is out of 100
  };

  const calculatePassFail = (marksheet) => {
    return marksheet.physics >= 33 && marksheet.chemistry >= 33 && marksheet.maths >= 33 ? 'Pass' : 'Fail';
  };

  return (
    <div>
      <h2 align="center">Marksheet List</h2>

      {/* Search Fields */}
      <div align="center" style={{ marginBottom: '20px' }}>
        <input
          type="text"
          placeholder="Search by Name"
          value={searchName}
          onChange={e => setSearchName(e.target.value)}
          style={{ marginRight: '10px' }}
        />
        <input
          type="text"
          placeholder="Search by Roll No"
          value={searchRollNo}
          onChange={e => setSearchRollNo(e.target.value)}
        />
      </div>

      <table border="1px" width="100%" align="center" className="table table-striped table-bordered">
        <thead align="center">
          <tr>
            <th>Name</th>
            <th>Roll No</th>
            <th>Physics</th>
            <th>Chemistry</th>
            <th>Maths</th>
            <th>Total</th>
            <th>Percentage</th>
            <th>Pass/Fail</th>
          </tr>
        </thead>
        <tbody align="center">
          {filteredMarksheets.map(marksheet => (
            <tr key={marksheet._id}>
              <td>{marksheet.name}</td>
              <td>{marksheet.rollNo}</td>
              <td>{marksheet.physics}</td>
              <td>{marksheet.chemistry}</td>
              <td>{marksheet.maths}</td>
              <td>{calculateTotal(marksheet)}</td>
              <td>{calculatePercentage(marksheet).toFixed(2)}%</td>
              <td>{calculatePassFail(marksheet)}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default MarksheetList;
